import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000';

function App() {
  const [rating, setRating] = useState(0);
  const [hoverRating, setHoverRating] = useState(0);
  const [review, setReview] = useState('');
  const [loading, setLoading] = useState(false);
  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (rating === 0) {
      setError('Please select a rating');
      return;
    }
    
    if (!review.trim()) {
      setError('Please write a review');
      return;
    }

    setLoading(true);
    setError(null);
    setResponse(null);

    try {
      const result = await axios.post(`${API_URL}/api/submit`, {
        rating,
        review: review.trim()
      });

      if (result.data.success) {
        setResponse(result.data.message);
        setRating(0);
        setReview('');
      }
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to submit. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app">
      <header className="header">
        <div className="container">
          <div className="logo">FYND</div>
          <nav className="nav">
            <span>Feedback Portal</span>
          </nav>
        </div>
      </header>

      <main className="main">
        <div className="container">
          <div className="hero">
            <h1>We Value Your Feedback</h1>
            <p>Help us improve your shopping experience</p>
          </div>

          <div className="form-card">
            <form onSubmit={handleSubmit}>
              <div className="form-section">
                <label>How would you rate your experience?</label>
                <div className="stars">
                  {[1, 2, 3, 4, 5].map((star) => (
                    <button
                      key={star}
                      type="button"
                      className={`star-btn ${(hoverRating || rating) >= star ? 'active' : ''}`}
                      onClick={() => setRating(star)}
                      onMouseEnter={() => setHoverRating(star)}
                      onMouseLeave={() => setHoverRating(0)}
                      disabled={loading}
                    >
                      <svg viewBox="0 0 24 24" fill={(hoverRating || rating) >= star ? "currentColor" : "none"} stroke="currentColor" strokeWidth="2">
                        <path d="M12 2l3.09 6.26L22 9.27l-5 4.87 1.18 6.88L12 17.77l-6.18 3.25L7 14.14 2 9.27l6.91-1.01L12 2z"/>
                      </svg>
                    </button>
                  ))}
                </div>
                {rating > 0 && <span className="rating-label">{rating} out of 5 stars</span>}
              </div>

              <div className="form-section">
                <label htmlFor="review">Share your experience</label>
                <textarea
                  id="review"
                  value={review}
                  onChange={(e) => setReview(e.target.value)}
                  placeholder="Tell us what you liked or how we can improve..."
                  rows="5"
                  disabled={loading}
                  maxLength="2000"
                />
                <div className="textarea-footer">
                  <span>{review.length}/2000</span>
                </div>
              </div>

              <button type="submit" className="submit-btn" disabled={loading || rating === 0 || !review.trim()}>
                {loading ? 'Submitting...' : 'Submit Feedback'}
              </button>
            </form>

            {error && (
              <div className="message error">
                <strong>Error:</strong> {error}
              </div>
            )}

            {response && (
              <div className="message success">
                <strong>Thank you!</strong>
                <p>{response}</p>
              </div>
            )}
          </div>
        </div>
      </main>

      <footer className="footer">
        <div className="container">
          <p>Â© 2026 Fynd. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
